	struct NapalmBounds {
		NapalmBounds() : bounds() {}
		NapalmBounds(IRec x) : bounds(x) {}

		// Add xy to both x and y
		NapalmBounds(IRec x, int xy) 
			: bounds(x) { bounds.setX(bounds.getX() + xy); bounds.setY(bounds.getY() + xy); };

		IRec get() { return bounds; }
		IRec set(IRec x) { bounds = x; }

		IRec bounds;
	};

